import React, { useState } from "react";
import UniversityData from "./UniversityData";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  LineElement,
  PointElement,
  CategoryScale,
  LinearScale
} from "chart.js";

ChartJS.register(LineElement, PointElement, CategoryScale, LinearScale);

const App = () => {
  const [selectedUniversity, setSelectedUniversity] = useState("");
  const [studentType, setStudentType] = useState("International");
  const [userGPA, setUserGPA] = useState("");
  const [userSAT, setUserSAT] = useState("");
  const [userMarks, setUserMarks] = useState("");

  const handleUniversityChange = (e) => {
    setSelectedUniversity(e.target.value);
  };

  const calculateAdmissionProbability = (avgGPA, avgSAT) => {
    const gpaScore = (parseFloat(userGPA) / avgGPA) * 100;
    const satScore = (parseFloat(userSAT) / avgSAT) * 100;
    const marksScore = (parseFloat(userMarks) / 100) * 100;
    const average = (gpaScore + satScore + marksScore) / 3;

    if (average >= 95) return "High";
    if (average >= 80) return "Moderate";
    return "Low";
  };

  const yearLabels = ["2025", "2024", "2023", "2022", "2021"];

  const selectedData = UniversityData.find(
    (uni) => uni.name === selectedUniversity
  );

  return (
    <div style={{ padding: "20px" }}>
      <h2>QS World University Rankings Explorer</h2>
      <div>
        <label>Select University: </label>
        <select onChange={handleUniversityChange} value={selectedUniversity}>
          <option value="">-- Select --</option>
          {UniversityData.map((uni) => (
            <option key={uni.name} value={uni.name}>
              {uni.name}
            </option>
          ))}
        </select>
      </div>

      {selectedData && (
        <div>
          <h3>Student Type:</h3>
          <button onClick={() => setStudentType("International")}>International</button>
          <button onClick={() => setStudentType("Domestic")}>Domestic</button>
          <h4>General QS Rank: {selectedData.generalQSRank}</h4>

          {selectedData.subjects.map((subject) => {
            const avgGPA = subject.gpaCutoffs.reduce((a, b) => a + b) / 5;
            const avgSAT = subject.satCutoffs.reduce((a, b) => a + b) / 5;

            return (
              <div key={subject.name} style={{ border: "1px solid #ccc", margin: "15px", padding: "10px" }}>
                <h3>{subject.name}</h3>
                <p><strong>Start Date:</strong> {subject.startDate}</p>
                <p><strong>Fees:</strong> {subject.fees[studentType]}</p>
                <p><strong>Eligibility:</strong> {subject.eligibility[studentType]}</p>
                <p><a href={subject.courseLink} target="_blank" rel="noopener noreferrer">Course Link</a></p>

                <h4>Cutoff History</h4>
                <table border="1" cellPadding="5">
                  <thead>
                    <tr>
                      <th>Year</th>
                      <th>QS Rank</th>
                      <th>GPA Cutoff</th>
                      <th>SAT Cutoff</th>
                    </tr>
                  </thead>
                  <tbody>
                    {yearLabels.map((year, i) => (
                      <tr key={year}>
                        <td>{year}</td>
                        <td>{subject.qsRankings[i]}</td>
                        <td>{subject.gpaCutoffs[i]}</td>
                        <td>{subject.satCutoffs[i]}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>

                <h4>Trend Chart</h4>
                <Line
                  data={{
                    labels: yearLabels,
                    datasets: [
                      {
                        label: "QS Rank",
                        data: subject.qsRankings,
                        borderColor: "blue",
                        fill: false
                      },
                      {
                        label: "GPA Cutoff",
                        data: subject.gpaCutoffs,
                        borderColor: "green",
                        fill: false
                      },
                      {
                        label: "SAT Cutoff",
                        data: subject.satCutoffs,
                        borderColor: "red",
                        fill: false
                      }
                    ]
                  }}
                />

                <h4>Admission Probability Estimator</h4>
                <div>
                  <label>Your GPA: </label>
                  <input
                    type="number"
                    step="0.01"
                    value={userGPA}
                    onChange={(e) => setUserGPA(e.target.value)}
                  />
                  <label>Your SAT Score: </label>
                  <input
                    type="number"
                    value={userSAT}
                    onChange={(e) => setUserSAT(e.target.value)}
                  />
                  <label>Your 12th Marks (%): </label>
                  <input
                    type="number"
                    value={userMarks}
                    onChange={(e) => setUserMarks(e.target.value)}
                  />
                </div>
                {userGPA && userSAT && userMarks && (
                  <p><strong>Estimated Admission Probability:</strong> {calculateAdmissionProbability(avgGPA, avgSAT)}</p>
                )}
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
};

export default App;
